import React, { Component }  from 'react';
import MUIDataTable from "mui-datatables";
import IconButton from '@material-ui/core/IconButton';
import DeleteIcon from '@material-ui/icons/Delete';
import SnackbarContent from '@material-ui/core/SnackbarContent';
import Paper from '@material-ui/core/Paper';



// const CustomToolbar = () => {

// };

const PatientsList = ({data, numRows}) => {
  const columns = ["Nombre", "Edad", "Email", "Activo"]; //ojo con PatientsMain y numcolumnas

  const options = {
    filterType: 'dropdown',
    rowsPerPage: numRows,
    rowsPerPageOptions: [numRows, numRows * 2, numRows * 3],
    textLabels:{
      body: '' //estp pa q cuando esten fetcheando los mensajes, aparezca en blanco el table
    },
    filterType: 'dropdown',
    // selectableRows: false,
    responsive: 'scroll',
    // customToolbar: () => {
    // return (
    //   <CustomToolbar />
    // )}
  };  


  return(
    <div>
      <SnackbarContent message={'Pacientes por renovar'} style={{position: 'absolute', width: '80%', margin: '-15px auto 0', justifyContent: 'center', backgroundColor: '#3f51b5'}} />
      <MUIDataTable
        title={['Pacientes']}
        data={data}
        columns={columns}
        options={options}
        style={{paddingTop: '30px'}}
      />
    </div>
  )
}

export default PatientsList;
